import { Admin, Resource } from "react-admin";
import jsonServerProvider from "ra-data-json-server";
import { UserList } from "./components/users";
//import simpleRestProvider from 'ra-data-simple-rest';

const dataProvider = jsonServerProvider('http://jsonplaceholder.typicode.com', (verb, resource, params) => {
  if (verb === 'GET' && resource === 'users') {
    // Disable the need for X-Total-Count header
    return { url: `${resource}?${stringify(params.query)}`, total: false };
  }
  // Fallback to default implementation
  return jsonServerProvider('http://jsonplaceholder.typicode.com')(verb, resource, params);
});
//const dataProvider = simpleRestProvider('https://se-diva-docs.herokuapp.com');

const App = () => (
  <Admin dataProvider={dataProvider}>
    <Resource name="applicants/view" list={UserList}/>
  </Admin>
);


export default App;
